import React, { Component } from 'react';
import Link from 'next/link'

class Auth extends Component {
  render () {
    return (
      <div>
        <h1>Auth</h1>

        <Link>
          <a href='/indix'>Home</a>
        </Link>
      </div>
    )
  }
}

export default Auth;
